wminc-error-move-unprefixed:
{{doc-important|Do not change <code><nowiki>{{MediaWiki:Wminc-error-help}}</nowiki></code>.}}
Refers to {{msg-mw|Wminc-error-help}}.

"Unprefixed" means that the page's title doesn't have a prefix such as "Wp/und/", which is required on Incubator pages.

randombytest:
{{doc-special|RandomByTest|unlisted=1}}
The special page goes to a random page in an incubator wiki. 
For more information see: [[mw:WikimediaIncubator]].

wminc-viewuserlang:
{{doc-special|ViewUserLang}}
The special page enables to look up the language and test wiki of a user.
See [[:File:Incubator-testwiki-viewuserlang.jpg]].

